import React from 'react'
import { useRoutes } from "react-router";
import "./App.css"
import Student from './Student'
import Userportal from './Userportal'

export default function App() {
   let element = useRoutes([
    {
      path: "/",
      element: <Userportal/>},

    { path: "/Student", element: <Student /> },
  ]);
  return element
}
